import React from "react";
import "./styles/global.css";
import Accordion from "./UI/1-atoms/Accordion";

const Accord = [
  {
    title: "Install Clario",
    content: "Relax and let Clario do the job.",
    id: "Clario1",
  },
  {
    title: "Set up your protection",
    content: "Relax and let Clario do the job.",
    id: "Clario",
  },
  {
    title: "Enjoy spy-free life",
    content: "Relax and let Clario do the job.",
    id: "Clario2",
  },
];

function App() {
  return (
    <div className={"max-w-[320px] mx-auto"}>
      <div>
        {Accord.map((el, ix) => {
          return (
            <Accordion
              sequence={ix + 1}
              accordionId={"InstallClario"}
              title={"Install Clario"}
              className={"w-full"}
            >
              Relax and let Clario do the job.
            </Accordion>
          );
        })}
      </div>
    </div>
  );
}

export default App;
